  - value: ' 255 individual Sheriff Deputies employed by 65 different parish sheriffs''
      offices in Louisiana have contributed various small amounts per month via payroll
      deduction into the PAC (commonly $6 per month but contribution amounts range
      from $0.93 to $51 during this reporting period); however'
  - value: ' there is no indididual Deputy that has exceeded the $200 aggregate itemization
      threshold during this reporting period. The total contributions for thisreporting  period
      has been revised to $20'
  - value: 358.50 due to a $780 staff clerical error that inadvertently added to the
      Report total some sheriff contributions that did not qualify for deposit since
      this is a combined federal/state account PAC--deputies contribute to the federal
      account and sheriffs contribute to the state account. Those ineligible sheriff
      contributions were returned without depositing them into the federal account
      and therefore the deputy contribution total has been revised downward to $20
  - value: 358.50.  --James S. Burland
  - value: ' Preparer'
  - value: ' 225-344-1659 phone.'
  expected_count: 4
  input: TEXT,SA11A1,SA11A1.4142,"3, 255 individual Sheriff Deputies employed by 65
    different parish sheriffs' offices in Louisiana have contributed various small
    amounts per month via payroll deduction into the PAC (commonly $6 per month but
    contribution amounts range from $0.93 to $51 during this reporting period); however,
    there is no indididual Deputy that has exceeded the $200 aggregate itemization
    threshold during this reporting period. The total contributions for thisreporting  period
    has been revised to $20,358.50 due to a $780 staff clerical error that inadvertently
    added to the Report total some sheriff contributions that did not qualify for
    deposit since this is a combined federal/state account PAC--deputies contribute
    to the federal account and sheriffs contribute to the state account. Those ineligible
    sheriff contributions were returned without depositing them into the federal account
    and therefore the deputy contribution total has been revised downward to $20,358.50.  --James
    S. Burland, Preparer, 225-344-1659 phone."
